  [],\n\t\"revision_timestamp\": \"2015-05-07T05:55:13.056482\",\n\t\"name\": \"saw-passive-wireless-sensor-rfid-tags-with-enhanced-range-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This proposal describes the development
  of passive wireless surfacenacoustic wave (SAW) RFID sensor-tags with enhanced range
  for remotenmonitoring of large groups of conventional sensors.  Passive wirelessnsensing
  tags using SAW technology have been demonstrated by RobertnBrocato at Sandia National
  Labs and others.  These sensor-tags consistnof a SAW device with an antenna attached
  to one port and sensor(s) andnreference impedance(s) connected to the other ports.
  \ RF signals arenreflected off of the surface wave device, and their reflectionncharacteristics
  are modified by changes in the impedance of the attachednsensor(s).  This proposal
  describes development of novel passivenwireless SAW sensor tags that combine radio
  frequency identificationn(RFID) coding with dispersive and low-loss SAW transducers
  andnreflectors.  The proposed devices utilize RFID reflective delay linencoding
  techniques to produce devices capable of data densities over 32nbits, enabling production
  of large codesets.  Variations in thenreflected RFID code are used to identify the
  device and to provide anmeasure of the attached sensor(s), along with any internal
  sensingnfunction(s).   The use of dispersive low-loss transducers and reflectorsnprovides
  increased processing gain and over 10 times the range ofnconventional SAW RFID tags.
  \ The proposed sensor devices also operate inna manner that is inherently immune
  to RF backscatter signals, furthernenhancing S/N.  Successful completion of the
  proposed Phase I activitiesnwill establish the technical feasibility of these sensor-tags,
  willnevaluate their performance in the laboratory when used with at least twonexternal
  sensor devices, and will provide performance projections fornuse with other sensors.
  \ At the end of Phase I, devices will be at TRLn4.  Phase II will result in development
  of multiple uniquelynidentifiable passive sensor-tags and interrogation systems
  operable tonwirelessly monitor sensors of interest to specific NASA programs (TRL6).\",\n\t\"license_title\":
